import React from "react";

const GoldenSpiralLoader = () => {
  return (
    <svg
      width="150"
      height="150"
      viewBox="0 0 150 150"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ transformOrigin: "50% 50%" }}
      className="golden-spiral-loader"
    >
      <path
        d="
          M 75 75
          L 75 37
          A 38 38 0 0 1 113 75
          L 113 113
          A 22 22 0 0 0 91 91
          L 91 56
          A 15 15 0 0 1 106 71
          L 106 106
          A 8 8 0 0 0 98 98
          L 98 79
          A 5 5 0 0 1 103 84
          L 103 103
          A 3 3 0 0 0 100 100
          L 100 87
        "
        stroke="#DAA520"
        strokeWidth="3"
        fill="none"
        strokeLinecap="round"
        strokeLinejoin="round"
      />
      <style>{`
        .golden-spiral-loader {
          animation: spin 2.5s linear infinite;
        }
        @keyframes spin {
          0% {
            transform: rotate(0deg);
          }
          100% {
            transform: rotate(-360deg);
          }
        }
      `}</style>
    </svg>
  );
};

export default GoldenSpiralLoader;
